import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class BookListComponent extends Component {
    constructor(props) {
        super(props);

        this.state = {
            ownedBooks: [],
            sharedBooks: [],
        };
        
        this.addBookList = this.addBookList.bind(this);
        this.fetchBooks = this.fetchBooks.bind(this);
    }

    componentDidMount() {
        this.fetchBooks();
    }

    fetchBooks() {
        fetch('http://localhost:8080/api/books')
            .then(response => response.json())
            .then(data => {
                // Separate owned and shared books based on a property (e.g., isOwned)
                const ownedBooks = data.filter(book => book.isOwned);
                const sharedBooks = data.filter(book => !book.isOwned);

                this.setState({ ownedBooks, sharedBooks });
            })
            .catch(error => {
                console.error('Error fetching data:', error);
                alert('There was an error fetching data. Please try again later.');
            });
    }

    addBookList(type) {
        const linkText = type === 'owned' ? 'Add Book List' : 'Add Shared Book';
        const toPath = type === 'owned' ? '/addBookList' : '/addSharedBook';

        return (
            <Link to={toPath} className='btn btn-success'>
                {linkText}
            </Link>
        );
    }

    renderBooks(books) {
        return (
            <tbody>
                {books.map(book => (
                    <tr key={book.bookId}>
                        <td>{book.bookTitle}</td>
                        <td>{book.bookAuthor}</td>
                        <td>{book.publishedYear}</td>
                        <td>{book.genre}</td>
                        <td>
                            <Link to={`/viewBookList/${book.bookId}`} className='btn btn-info' style={{ marginLeft: '10px' }}>
                                View
                            </Link>
                        </td>
                    </tr>
                ))}
            </tbody>
        );
    }

    render() {
        return (
            <div>
                <div className='text-left'>
                    {this.addBookList('owned')} {this.addBookList('shared')}
                </div>

                <h2 className='text-center'>Owned Books</h2>
                <div className='row'>
                    <table className='table table-striped'>
                        <thead>
                            <tr>
                                <th>Book Title</th>
                                <th>Book Author</th>
                                <th>Published Year</th>
                                <th>Genre</th>
                                <th>Action</th>
                            </tr>
                        </thead>
                        {this.renderBooks(this.state.ownedBooks)}
                    </table>
                </div>

                <h2 className='text-center'>Shared Books</h2>
                <div className='row'>
                    <table className='table table-striped'>
                        <thead>
                            <tr>
                                <th>Book Title</th>
                                <th>Book Author</th>
                                <th>Published Year</th>
                                <th>Genre</th>
                                <th>Action</th>
                            </tr>
                        </thead>
                        {this.renderBooks(this.state.sharedBooks)}
                    </table>
                </div>
            </div>
        );
    }
}

export default BookListComponent;
